import Expenses from "./components/Expenses/Expenses";
const App = () => {
  const expense = [
    {
      id: "e1",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e2",
      title: "Toilet Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e3",
      title: "Bed Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
  ];
  return (
    //JSx sintaxis
    <div>
      <h2>Let's get started!</h2>
      <Expenses item={expense} />
    </div>
  );
};

//best practice put new compent into new files
export default App;


